import React from "react";
import "./Sidenav.css";

const Sidenav = () => {
  return (
    <nav className="navContainer">
      <a className="navLink" href="#">
        Tmail
      </a>
      <a className="navLink" href="#">
        Inbox
      </a>
      <a className="navLink" href="#">
        Keywords
      </a>
      <a className="navLink" href="#">
        Settings
      </a>
    </nav>
  );
};

export default Sidenav;
